(b) is correct, since using @Override allows us to have some compile time checks to ensure that we are overriding the correct method from the superclass, not overloading, which is when we define two functions with the same name, but different types for parameters.(c) is correct, since try-catch blocks are for all exceptions, not just checked exceptions. Consider try {
  int[] xs = {0, 1};
  System.out.println(Integer.toString(xs[2]);
} catch (ArrayOutOfBoundsException e) {
  System.out.println("OOB");
}
This code (outside of any syntax errors I may have made) is legal.

